import { makeStyles } from "@material-ui/core/styles";

export default makeStyles((theme) => ({
  container: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  },
  dashboard: {
    [theme.breakpoints.up("sm")]: {
      paddingBottom: "5%",
      width: "360px",
      margin: "auto",
      textAlign: "center",
    },
  },
  desktop: {
    [theme.breakpoints.up("sm")]: {
      display: "none",
    },
  },
  mobile: {
    [theme.breakpoints.down("sm")]: {
      display: "none",
    },
  },
  last: {
    [theme.breakpoints.down("sm")]: {
      marginBottom: theme.spacing(3),
      paddingBottom: "200px",
    },
  },
  section: {
    margin: "auto",
    maxWidth: "94%",
  },
}));
